import styled from 'styled-components';

let StyledContainer = styled.div`
margin: 10px auto;
    width: 350px;
    display: flex;
    flex-direction: column;
`;
let StyledButton = styled.button`
width:70%;
height:35px;
margin:3px 0px;
font-family:-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
font-weight:bold;
border-radius:10px;
border:2px solid black;
cursor: pointer;
background-color:#ffffff;
outline:none;
&:hover{
        background: rgba(255,255,255,.8);
        color: black;
     }
`
let StyledInput = styled.input`

`


const SignUpRegularay = () => {
    return (
        <StyledContainer>
            <StyledInput placeholder="First Name" type="text"/>
            <StyledInput placeholder="Last name" type="text"/>
            <StyledInput placeholder="Email Address" type="email"/>
            <StyledInput placeholder="Password" type="password"/>
            <StyledInput placeholder="Rewrite Password" type="password"/>
        </StyledContainer>
    )
}
export default SignUpRegularay;
